$("#selector,#sort").on("click","li",function(){$(this).siblings("li").removeClass("active");$(this).addClass("active")});var app=angular.module("myApp",["ng"]);app.controller("parentCtrl",["$scope","$http",function(a,b){a.getList=function(c){if(c<1){return}b.get("data/select.php"+location.search+"&pageNum="+c).success(function(d){if(c>d.pageCount){return}a.data=d;if(c!=1){jQuery(window).scrollTop(550)}a.pageArray=[];if(d.pageNum>2&&d.pageNum<d.pageCount-1){for(var e=-2;e<3;e++){a.pageArray[e+2]=parseInt(d.pageNum)+e}}else{if(d.pageNum<=2){if(d.pageCount>5){a.pageArray=[1,2,3,4,5]}else{for(var e=0;e<d.pageCount;e++){a.pageArray[e]=e+1}}}else{if(d.pageNum>d.pageCount-2){if(d.pageCount>5){a.pageArray=[d.pageCount-4,d.pageCount-3,d.pageCount-2,d.pageCount-1,d.pageCount]}else{for(var e=d.pageCount;e>0;e--){a.pageArray.unshift(e)}}}}}$("#search_kw").val(decodeURIComponent(location.search.slice(9)))})};a.getList(1)}]);